import React from 'react';
import { Box } from '../components/Box';
import { Flex } from '../components/Flex';
import { Text } from '../components/Text';

function Home() {
  return (
    <Box>
      <Flex
        css={{
          padding: '$5 $6',
          flexWrap: 'wrap',
          gap: '$6',
        }}
      >
        <TextTable weight="regular">Bb</TextTable>
        <TextTable weight="medium">Yy</TextTable>
        <TextTable weight="semibold">Rr</TextTable>
        <TextTable weight="bold">Dd</TextTable>
      </Flex>

      <Box
        css={{
          padding: '$5 $6',
          display: 'flex',
          flexDirection: 'column',
          gap: '$3',
        }}
      >
        <Text size="5" weight="regular">
          No need to worry 'bout tomorrow, and yesterday is gone
        </Text>
        <Text size="5" weight="medium">
          No need to worry 'bout tomorrow, and yesterday is gone
        </Text>
        <Text size="5" weight="semibold">
          No need to worry 'bout tomorrow, and yesterday is gone
        </Text>
        <Text size="5" weight="bold">
          No need to worry 'bout tomorrow, and yesterday is gone
        </Text>
      </Box>
    </Box>
  );
}

export default Home;

const TextTable = ({ weight, children }: { weight?: any }) => (
  <Box
    css={{
      display: 'grid',
      gap: '$3',
      gridTemplateColumns: 'repeat(1, max-content)',
      gridAutoRows: 'max-content',
      alignItems: 'baseline',
      textAlign: 'center',
    }}
  >
    <Text weight={weight} size="9">
      {children}
    </Text>

    <Text weight={weight} size="8">
      {children}
    </Text>

    <Text weight={weight} size="7">
      {children}
    </Text>

    <Text weight={weight} size="6">
      {children}
    </Text>

    <Text weight={weight} size="5">
      {children}
    </Text>

    <Text weight={weight} size="4">
      {children}
    </Text>

    <Text weight={weight} size="3">
      {children}
    </Text>

    <Text weight={weight} size="2">
      {children}
    </Text>

    <Text weight={weight} size="1">
      {children}
    </Text>
  </Box>
);
